import React from 'react';
import ReactDOM from 'react-dom';

const AppHeader = () => {
  return <h1> My Todo List </h1>;
};

const SearchPanel = () => {
  return <input placeholder="search"/>;
};

const TodoList = () => {
  return(
    <ul>
      <li> Learn React </li>
      <li> My Awesome App </li>
    </ul>
  );
};
const el = (
   <div>
      <AppHeader />
      <TodoList />
      <SearchPanel />
   </div>
);

ReactDOM.render(el,
  document.getElementById('root'));
